import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 16.1-235.1 Provision of court services; replacement intake officers.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-235.1.md","filePath":"vacode/16.1-235.1.md"}'),i={name:"vacode/16.1-235.1.md"},o=a('<h1 id="§-16-1-235-1-provision-of-court-services-replacement-intake-officers" tabindex="-1">§ 16.1-235.1 Provision of court services; replacement intake officers. <a class="header-anchor" href="#§-16-1-235-1-provision-of-court-services-replacement-intake-officers" aria-label="Permalink to &quot;§ 16.1-235.1 Provision of court services; replacement intake officers.&quot;">​</a></h1><p>The chief judge may make arrangements for a replacement intake officer from another court service unit to ensure the capability of a prompt response in matters under § <a href="http://law.lis.virginia.gov/vacode/16.1-255/" target="_blank" rel="noreferrer">16.1-255</a> or <a href="http://law.lis.virginia.gov/vacode/16.1-260/" target="_blank" rel="noreferrer">16.1-260</a> during hours the court is closed. The replacement intake officer shall have all the authority and power of an intake officer of that district when authorized in writing by the appointing authority and by the chief judge of that district.</p><p>2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0700" target="_blank" rel="noreferrer">700</a>; 2012, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0164" target="_blank" rel="noreferrer">164</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0456" target="_blank" rel="noreferrer">456</a>.</p>',3),n=[o];function c(s,f,l,h,p,_){return r(),t("div",null,n)}const g=e(i,[["render",c]]);export{v as __pageData,g as default};
